import React, {useState} from 'react';
import './styles.css';

var ManagerAlbum = () => {
    return(
        <div className='container'>
            <h1 className='center'>هذه الصفحهة تحت الإنشاء وسيتم إتاحتها في أقرب وقت ممكن</h1>
            <br />
            <h4 className='center'>إذا اردت اضافة اي صورة إلى الألبوم يمكنك التواصل مع مطور الموقع من خلال الواتساب وارسال الصورة والعنوان ليتم اضافتها</h4>
            <br />
            <p className='center'>3309 342 56 +966</p>
        </div>
    );
}

export default ManagerAlbum;
